import { Component } from "react";
import { Link } from "react-router-dom"
import "./slidestyle.css"
class SlideBar extends Component {
    render() {
        return (
            <div className="col-sm-3 text-center p-3 bg-white" style={{ minHeight: "700px", borderRight: "2px solid #333E47" }}>
                <h3>KavinGroups</h3>


                <Link to="/admin/alltask" className="btn s1 text-primary">All Tasks</Link><br></br>
                <Link to="/admin/alltasks" className="btn s1 text-primary">Create Tasks</Link><br></br>
                <Link to="/admin/alltasks" className="btn s1 text-primary">Assign Task</Link><br></br>

            </div>
        )
    }
}

export default SlideBar
